    question: "\u0423\u0441\u0432\u043e\u0435\u043d\u0438\u0435 \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u0451\u043d\u043d\u043e\u0433\u043e \u0443\u0440\u043e\u0432\u043d\u044f \u043d\u0430\u0443\u0447\u043d\u044b\u0445 \u0437\u043d\u0430\u043d\u0438\u0439, \u0444\u043e\u0440\u043c\u0438\u0440\u043e\u0432\u0430\u043d\u0438\u0435 \u043c\u0438\u0440\u043e\u0432\u043e\u0437\u0437\u0440\u0435\u043d\u0438\u044f, \t\n\u043f\u043e\u0437\u043d\u0430\u0432\u0430\u0442\u0435\u043b\u044c\u043d\u043e\u0439 \u0434\u0435\u044f\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u0438, \t\u0441\u043f\u043e\u0441\u043e\u0431\u043e\u0432 \u043c\u044b\u0448\u043b\u0435\u043d\u0438\u044f \t\u2013 \u0437\u0430\u0434\u0430\u0447\u0438:",
    answer: "\u0443\u043c\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0433\u043e \u0432\u043e\u0441\u043f\u0438\u0442\u0430\u043d\u0438\u044f",
