    answer: "\u0443\u043c\u0435\u043d\u0438\u044f,  \u0434\u043e\u0432\u0435\u0434\u0435\u043d\u0438\u044f  \u0434\u043e  \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0437\u043c\u0430,  \u0432\u044b\u0441\u043e\u043a\u043e\u0439  \u0441\u0442\u0435\u043f\u0435\u043d\u0438  \u0441\u043e\u0432\u0435\u0440\u0448\u0435\u043d\u0441\u0442\u0432\u0430\t \u0441\u0438\u0441\u0442\u0435\u043c\u0430 \t\n\u043f\u0440\u0438\u043e\u0431\u0440\u0435\u0442\u0435\u043d\u043d\u044b\u0445 \u0432 \u043f\u0440\u043e\u0446\u0435\u0441\u0441\u0435 \u043e\u0431\u0443\u0447\u0435\u043d\u0438\u044f \u0437\u043d\u0430\u043d\u0438\u0439, \u0443\u043c\u0435\u043d\u0438\u0439, \u0441\u043f\u043e\u0441\u043e\u0431\u043e\u0432 \u043c\u044b\u0448\u043b\u0435\u043d\u0438\u044f",
    options: ["\u0443\u043c\u0435\u043d\u0438\u044f,  \u0434\u043e\u0432\u0435\u0434\u0435\u043d\u0438\u044f  \u0434\u043e  \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0437\u043c\u0430,  \u0432\u044b\u0441\u043e\u043a\u043e\u0439  \u0441\u0442\u0435\u043f\u0435\u043d\u0438  \u0441\u043e\u0432\u0435\u0440\u0448\u0435\u043d\u0441\u0442\u0432\u0430\t \u0441\u0438\u0441\u0442\u0435\u043c\u0430 \t\n\u043f\u0440\u0438\u043e\u0431\u0440\u0435\u0442\u0435\u043d\u043d\u044b\u0445 \u0432 \u043f\u0440\u043e\u0446\u0435\u0441\u0441\u0435 \u043e\u0431\u0443\u0447\u0435\u043d\u0438\u044f \u0437\u043d\u0430\u043d\u0438\u0439, \u0443\u043c\u0435\u043d\u0438\u0439, \u0441\u043f\u043e\u0441\u043e\u0431\u043e\u0432 \u043c\u044b\u0448\u043b\u0435\u043d\u0438\u044f", "\u043f\u0443\u0442\u044c \u0434\u043e\u0441\u0442\u0438\u0436\u0435\u043d\u0438\u044f \u0446\u0435\u043b\u0435\u0439 \u0438 \u0437\u0430\u0434\u0430\u0447 \u043e\u0431\u0443\u0447\u0435\u043d\u0438\u044f", "\u0441\u043e\u0432\u043e\u043a\u0443\u043f\t\u043d\u043e\u0441\u0442\u044c \u0438\u0434\u0435\u0439 \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430, \u0432 \u043a\u043e\u0442\u043e\u0440\u044b\u0445 \u0432\u044b\u0440\u0430\u0436\u0430\u0435\u0442\u0441\u044f \u0442\u0435\u043e\u0440\u0435\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0435 \u043e\u0432\u043b\u0430\u0434\u0435\u043d\u0438\u0435 \u044d\u0442\u0438\u043c \t\n\u043f\u0440\u0435\u0434\u043c\u0435\u0442\u043e\u043c", "\u043e\u0432\u043b\u0430\u0434\u0435\u043d\u0438\u0435 \u0441\u043f\u043e\u0441\u043e\u0431\u0430\u043c\u0438  \u043f\u0440\u0438\u043c\u0435\u043d\u0435\u043d\u0438\u044f \u0443\u0441\u0432\u043e\u0435\u043d\u043d\u044b\u0445  \u0437\u043d\u0430\u043d\u0438\u0439 \u043d\u0430 \u043f\u0440\u0430\u043a\u0442\u0438\u043a\u0435", ""]
