    question: "\u041f\u0435\u0434\u0430\u0433\u043e\u0433\u0438\u043a\u0430  \u0432\u043e\u0437\u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044f  \u043d\u0430  \u043b\u0438\u0447\u043d\u043e\u0441\u0442\u044c,  \u0433\u0434\u0435  \u0443\u0447\u0435\u043d\u0438\u043a  (\u0432\u043e\u0441\u043f\u0438\u0442\u0430\u043d\u043d\u0438\u043a)  \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \t\n\u043e\u0431\u044a\u0435\u043a\u0442\u043e\u043c  \u043f\u0435\u0434\u0430\u0433\u043e\u0433\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u0432\u043e\u0437\u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044f, \u0430 \u0446\u0435\u043b\u044c\u044e \u0432\u044b\u0441\u0442\u0443\u043f\u0430\u044e\u0442 \u0437\u043d\u0430\u043d\u0438\u044f, \u0443\u043c\u0435\u043d\u0438\u044f \u0438 \u043d\u0430\u0432\u044b\u043a\u0438 \t\u2013",
