    question: "\u041a\u0430\u0447\u0435\u0441\u0442\u0432\u0430 \u0438 \u0441\u0432\u043e\u0439\u0441\u0442\u0432\u0430, \u043f\u0435\u0440\u0435\u0434\u0430\u044e\u0449\u0438\u0435\u0441\u044f \u043f\u043e \u043d\u0430\u0441\u043b\u0435\u0434\u0441\u0442\u0432\u0443:",
