{
    numb: 165,
    question: "\u0426\u0438\u0444\u0440\u043e\u0432\u0430\u044f \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u0442\u0435\u043b\u044c\u043d\u0430\u044f \u0441\u0440\u0435\u0434\u0430 \t- \u044d\u0442\u043e\t:",
    answer: "\u043a\u043e\u043c\u043f\u043b\u0435\u043a\u0441  \u0443\u0441\u043b\u043e\u0432\u0438\u0439  \u0438  \u0432\u043e\u0437\u043c\u043e\u0436\u043d\u043e\u0441\u0442\u0435\u0439  \u0434\u043b\u044f  \u043e\u0431\u0443\u0447\u0435\u043d\u0438\u044f,  \u0440\u0430\u0437\u0432\u0438\u0442\u0438\u044f,  \u0441\u043e\u0446\u0438\u0430\u043b\u0438\u0437\u0430\u0446\u0438\u0438, \t\n\u0432\u043e\u0441\u043f\u0438\u0442\u0430\u043d\u0438\u044f \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430",
    options: ["\u043a\u043e\u043c\u043f\u043b\u0435\u043a\u0441  \u0443\u0441\u043b\u043e\u0432\u0438\u0439  \u0438  \u0432\u043e\u0437\u043c\u043e\u0436\u043d\u043e\u0441\u0442\u0435\u0439  \u0434\u043b\u044f  \u043e\u0431\u0443\u0447\u0435\u043d\u0438\u044f,  \u0440\u0430\u0437\u0432\u0438\u0442\u0438\u044f,  \u0441\u043e\u0446\u0438\u0430\u043b\u0438\u0437\u0430\u0446\u0438\u0438, \t\n\u0432\u043e\u0441\u043f\u0438\u0442\u0430\u043d\u0438\u044f \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430", "\u043e\u0434\u043d\u0430 \u0438\u0437 \u043e\u0442\u0440\u0430\u0441\u043b\u0435\u0439 \u0446\u0438\u0444\u0440\u043e\u0432\u043e\u0439 \u0434\u0438\u0434\u0430\u043a\u0442\u0438\t\u043a\u0438", "\u043d\u0430\u0443\u043a\u0430 \u043e\u0431 \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u0438 \u043f\u0440\u043e\u0446\u0435\u0441\u0441\u0430 \u043e\u0431\u0443\u0447\u0435\u043d\u0438\u044f \u0432 \u0443\u0441\u043b\u043e\u0432\u0438\u044f\u0445 \u0446\u0438\u0444\u0440\u043e\u0432\u043e\u0433\u043e \u043e\u0431\u0449\u0435\u0441\u0442\u0432\u0430", "\u0442\u0440\u0430\u043d\u0441 \u0438\u043d\u0442\u0435\u0433\u0440\u0430\u043b\u044c\u043d\u0430\u044f \u043e\u0431\u043b\u0430\u0441\u0442\u044c \u043d\u0430\u0443\u0447\u043d\u043e\u0433\u043e \u0437\u043d\u0430\u043d\u0438\u044f", "\u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u0442\u0435\u043b\u044c\u043d\u0430\u044f \u0434\u0435\u044f\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u044c, \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u043a\u043b\u044e\u0447\u0435\u0432\u044b\u043c\u0438 \u0444\u0430\u043a\u0442\u043e\u0440\u0430\u043c\u0438 \u044f\u0432\u043b\u044f\u044e\u0442\u0441\u044f \u0434\u0430\u043d\u043d\u044b\u0435 \t\n\u0432 \u0446\u0438\u0444\u0440\u043e\u0432\u043e\u043c \u0444\u043e\u0440\u043c\u0430\u0442\u0435"]
}
,
{
    numb: 166,
    question: "\u0421\u043e\u0434\u0435\u0440\u0436\u0430\u043d\u0438\u0435\u043c \u043e\u0431\u0443\u0447\u0435\u043d\u0438\u044f \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f:",
    answer: "\u0432\u0441\u0435 \u0432\u0438\u0434\u044b \u0447\u0435\u043b\u043e\u0432\u0435\u0447\u0435\u0441\u043a\u043e\u0439 \u0434\u0435\u044f\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u0438",
    options: ["\u0432\u0441\u0435 \u0432\u0438\u0434\u044b \u0447\u0435\u043b\u043e\u0432\u0435\u0447\u0435\u0441\u043a\u043e\u0439 \u0434\u0435\u044f\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u0438", "\u0437\u043d\u0430\u043d\u0438\u0435 \u0441\u0430\u043c\u043e \u043f\u043e \u0441\u0435\u0431\u0435", "\u043e\u0442\u0434\u0435\u043b\u044c\u043d\u044b\u0435 \u0443\u043c\u0435\u043d\u0438\u044f", "\u043e\u0442\u0434\u0435\u043b\u044c\u043d\u044b\u0435 \u043d\u0430\u0432\u044b\u043a\u0438", "\u043e\u0431\u0449\u0438\u0435 \u0437\u043d\u0430\u043d\u0438\u044f"]
}
