{
    numb: 167,
    question: "\u0410\u043a\u0441\u0435\u043b\u0435\u0440\u0430\u0446\u0438\u044f \t- \u044d\u0442\u043e:",
    answer: "\u0443\u0441\u043a\u043e\u0440\u0435\u043d\u0438\u0435 \u0444\u0438\u0437\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u0438 \u043f\u0441\u0438\u0445\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u0440\u0430\u0437\u0432\u0438\u0442\u0438\u044f \u043b\u0438\u0447\u043d\u043e\u0441\u0442\u0438 \u0432 \u0434\u0435\u0442\u0441\u043a\u043e\u043c \u0438 \t \t\n\u043f\u043e\u0434\u0440\u043e\u0441\u0442\u043a\u043e\u0432\u043e\u043c \u0432\u043e\u0437\u0440\u0430\u0441\u0442\u0435",
    options: ["\u0443\u0441\u043a\u043e\u0440\u0435\u043d\u0438\u0435 \u0444\u0438\u0437\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u0438 \u043f\u0441\u0438\u0445\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u0440\u0430\u0437\u0432\u0438\u0442\u0438\u044f \u043b\u0438\u0447\u043d\u043e\u0441\u0442\u0438 \u0432 \u0434\u0435\u0442\u0441\u043a\u043e\u043c \u0438 \t \t\n\u043f\u043e\u0434\u0440\u043e\u0441\u0442\u043a\u043e\u0432\u043e\u043c \u0432\u043e\u0437\u0440\u0430\u0441\u0442\u0435", "\u0443\u0441\u043a\u043e\u0440\u0435\u043d\u0438\u0435 \u0438\u043d\u0434\u0438\u0432\u0438\u0434\u0443\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u0440\u0430\u0437\u0432\u0438\u0442\u0438\u044f \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430 \u0432 \u044e\u043d\u043e\u0448\u0435\u0441\u043a\u043e\u043c \u0432\u043e\u0437\u0440\u0430\u0441\u0442\u0435", "\u043f\u0440\u043e\u044f\u0432\u043b\u0435\u043d\u0438\u0435 \u043d\u0430\u0441\u0442\u043e\u0439\u0447\u0438\u0432\u043e\u0441\u0442\u0438 \u043b\u0438\u0447\u043d\u043e\u0441\u0442\u0438 \u0432 \u0434\u043e\u0441\u0442\u0438\u0436\u0435\u043d\u0438\u0438 \u043f\u043e\u0441\u0442\u0430\u0432\u043b\u0435\u043d\u043d\u044b\u0445 \u0437\u0430\u0434\u0430\u0447", "\u0443\u0441\u043a\u043e\u0440\u0435\u043d\u0438\t\u0435 \u0441\u043e\u043c\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u0440\u0430\u0437\u0432\u0438\u0442\u0438\u044f \u0438 \u0444\u0438\u0437\u0438\u043e\u043b\u043e\u0433\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u0441\u043e\u0437\u0440\u0435\u0432\u0430\u043d\u0438\t\u044f \u0434\u0435\u0442\u0435\u0439 \u0438 \t\n\u043f\u043e\u0434\u0440\u043e\u0441\u0442\u043a\u043e\u0432, \u043f\u0440\u043e\u044f\u0432\u043b\u044f\u044e\u0448\u0438\u0445\t\u0441\u044f \u0432 \u0431\u043e\u043b\u0435\u0435 \u0440\u0430\u043d\u043d\u0438\u0445 \u0441\u0440\u043e\u043a\u0430\u0445 \u043f\u043e\u043b\u043e\u0432\u043e\u0433\u043e \u0441\u043e\u0437\u0440\u0435\u0432\u0430\u043d\u0438\u044f", "\u0443\u0441\u043a\u043e\u0440\u0435\u043d\u0438\u0435 \u043f\u043e\u043b\u043e\u0432\u043e\u0433\u043e \u0441\u043e\u0437\u0440\u0435\u0432\u0430\u043d\u0438\u044f \u043b\u0438\u0447\u043d\u043e\u0441\u0442\u0438, \u0443\u0432\u0435\u043b\u0438\u0447\u0435\u043d\u0438\u0435 \u043c\u0430\u0441\u0441\u044b \u0438 \u0434\u043b\u0438\u043d\u044b \u0442\u0435\u043b\u0430 \u0438 \t\n\u0441\u043a\u043e\u0440\u043e\u0441\u0442\u0438 \u0435\u0451 \u043d\u0430\u0440\u0430\u0441\u0442\u0430\u043d\u0438\u044f \u0443 \u0434\u0435\u0442\u0435\u0439 \u0438 \t\u043f\u043e\u0434\u0440\u043e\u0441\u0442\u043a\u043e\u0432"]
}
