{
    numb: 168,
    question: "\u041c\u0435\u0442\u043e\u0434\u043e\u043b\u043e\u0433\u0438\u0447\u0435\u0441\u043a\u043e\u0439  \u043e\u0441\u043d\u043e\u0432\u043e\u0439  \u0438\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u043d\u0438\u044f  \u043f\u0435\u0434\u0430\u0433\u043e\u0433\u0438\u0447\u0435\u0441\u043a\u043e\u0439  \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u0438 \t\n\u044f\u0432\u043b\u044f\u044e\u0442\u0441\u044f:",
    answer: "\u043e\u0431\u0449\u0438\u0435 \u043c\u0435\u0442\u043e\u0434\u044b \u043d\u0430\u0443\u0447\u043d\u043e\u0433\u043e \u043f\u043e\u0437\u043d\u0430\u043d\u0438\u044f",
    options: ["\u043e\u0431\u0449\u0438\u0435 \u043c\u0435\u0442\u043e\u0434\u044b \u043d\u0430\u0443\u0447\u043d\u043e\u0433\u043e \u043f\u043e\u0437\u043d\u0430\u043d\u0438\u044f", "\u0433\u043d\u043e\u0441\u0435\u043e\u043b\u043e\u0433\u0438\u044f", "\u0440\u0430\u0437\u0432\u0438\u0442\u0438\u0435 \u043b\u0438\u0447\u043d\u043e\u0441\u0442\u0438 \u0443\u0447\u0435\u043d\u0438\u043a\u0430", "\u0432\u0441\u0435\u0441\u0442\u043e\u0440\u043e\u043d\u043d\u0435\u0435 \u0438 \u0433\u0430\u0440\u043c\u043e\u043d\u0438\u0447\u043d\u043e\u0435 \u0440\u0430\u0437\u0432\u0438\u0442\u0438\u0435 \u043b\u0438\u0447\u043d\u043e\u0441\u0442\u0438", "\u0442\u0435\u043e\u0440\u0438\u044f \u043f\u043e\u0437\u043d\u0430\u043d\u0438\u044f"]
}
