{
    numb: 171,
    question: "\u0423\u0440\u043e\u043a\u0438 \u044d\u0442\u043e\u0433\u043e \u0442\u0438\u043f\u0430 \u043f\u0440\u0435\u0434\u043d\u0430\u0437\u043d\u0430\u0447\u0430\u044e\u0442\u0441\u044f \u0434\u043b\u044f \u043a\u043e\u043d\u0442\u0440\u043e\u043b\u044f \u0437\u0430 \u0443\u0440\u043e\u0432\u043d\u0435\u043c \u0443\u0441\u0432\u043e\u0435\u043d\u0438\u044f \t\n\u0443\u0447\u0430\u0449\u0438\u043c\u0438\u0441\u044f \u0442\u0435\u043e\u0440\u0435\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b\u0430, \u0441\u0444\u043e\u0440\u043c\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u043e\u0441\u0442\u044c\u044e \u0443\u043c\u0435\u043d\u0438\u0439 \u0438 \u043d\u0430\u0432\u044b\u043a\u043e\u0432 (\u043f\u043e \n\u0442\u0440\u0430\u0434\u0438\u0446\u0438\u043e\u043d\u043d\u043e\u0439 \u043f\u0435\u0434\u0430\u0433\u043e\u0433\u0438\u043a\u0435):",
    answer: "\u0443\u0440\u043e\u043a \u043a\u043e\u043d\u0442\u0440\u043e\u043b\u044f \u0438 \t\u043a\u043e\u0440\u0440\u0435\u043a\u0446\u0438\u0438",
    options: ["\u0443\u0440\u043e\u043a \u043a\u043e\u043d\u0442\u0440\u043e\u043b\u044f \u0438 \t\u043a\u043e\u0440\u0440\u0435\u043a\u0446\u0438\u0438", "\u043a\u043e\u043c\u0431\u0438\u043d\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u044b\u0439 \u0443\u0440\u043e\u043a.", "\u0443\u0440\u043e\u043a \u0437\u0430\u043a\u0440\u0435\u043f\u043b\u0435\u043d\u0438\u044f.", "\u0443\u0440\u043e\u043a \u043e\u0431\u043e\u0431\u0449\u0435\u043d\u0438\u044f \u0438 \u0441\u0438\u0441\u0442\u0435\u043c\u0430\u0442\u0438\u0437\u0430\u0446\u0438\u0438 \u0437\u043d\u0430\u043d\u0438\u0439.", "\u0443\u0440\u043e\u043a \u0438\u0437\u0443\u0447\u0435\u043d\u0438\u044f \u043d\u043e\u0432\u044b\u0445 \u0437\u043d\u0430\u043d\u0438\u0439."]
}
