{
    numb: 194,
    question: "\u0413\u0440\u0443\u043f\u043f\u0430 \t\u2013 \u044d\u0442\u043e:",
    answer: "\u0441\u043e\u0432\u043e\u043a\u0443\u043f\u043d\u043e\u0441\u0442\u044c \u043b\u044e\u0434\u0435\u0439, \u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u0441\u0442\u0440\u0435\u043c\u044f\u0442\u0441\u044f \u043a \u0441\u043e\u0432\u043c\u0435\u0441\u0442\u043d\u043e\u0439 \u0434\u0435\u044f\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u0438, \u043f\u0440\u0435\u0441\u043b\u0435\u0434\u0443\u044e\u0442 \t\n\u0434\u043e\u0441\u0442\u0438\u0436\u0435\u043d\u0438\u0435 \u043e\u0431\u0449\u0438\u0445 \u0446\u0435\u043b\u0435\u0439",
    options: ["\u0441\u043e\u0432\u043e\u043a\u0443\u043f\u043d\u043e\u0441\u0442\u044c \u043b\u044e\u0434\u0435\u0439, \u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u0441\u0442\u0440\u0435\u043c\u044f\u0442\u0441\u044f \u043a \u0441\u043e\u0432\u043c\u0435\u0441\u0442\u043d\u043e\u0439 \u0434\u0435\u044f\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u0438, \u043f\u0440\u0435\u0441\u043b\u0435\u0434\u0443\u044e\u0442 \t\n\u0434\u043e\u0441\u0442\u0438\u0436\u0435\u043d\u0438\u0435 \u043e\u0431\u0449\u0438\u0445 \u0446\u0435\u043b\u0435\u0439", "\u0444\u043e\u0440\u043c\u0430 \u043a\u043e\u043b\u043b\u0435\u043a\u0442\u0438\u0432\u0430", "\u0441\u043e\u0446\u0438\u0430\u043b\u044c\u043d\u043e \u0443\u0441\u0442\u043e\u0439\u0447\u0438\u0432\u0430\u044f \t\u0441\u043e\u0432\u043e\u043a\u0443\u043f\u043d\u043e\u0441\u0442\u044c \u043b\u044e\u0434\u0435\u0439, \u0441\u0432\u044f\u0437\u0430\u043d\u043d\u044b\u0445 \u0441\u0438\u0441\u0442\u0435\u043c\u043e\u0439 \u043e\u0442\u043d\u043e\u0448\u0435\u043d\u0438\u0439, \t\n\u0440\u0435\u0433\u0443\u043b\u0438\u0440\u0443\u0435\u043c\u0430\u044f \u043e\u0431\u0449\u0438\u043c\u0438 \u0446\u0435\u043d\u043d\u043e\u0441\u0442\u044f\u043c\u0438 \u0438 \u043d\u043e\u0440\u043c\u0430\u043c\u0438", "\u0441\u043e\u0432\u043e\u043a\u0443\u043f\u043d\u043e\u0441\u0442\u044c \u043b\u044e\u0434\u0435\u0439, \u043e\u0431\u043b\u0430\u0434\u0430\u044e\u0449\u0438\u0445 \u043a\u0430\u043a\u0438\u043c\u0438\t-\u0442\u043e \u043e\u0431\u0449\u0438\u043c\u0438 \u043f\u0440\u0438\u0437\u043d\u0430\u043a\u0430\u043c\u0438", "\u0441\u043e\u0432\u043e\u043a\u0443\u043f\u043d\u043e\u0441\u0442\u044c \u043b\u044e\u0434\u0435\u0439 \u0432 \u043e\u0431\u0449\u0435\u0441\u0442\u0432\u0435"]
}
