{
    numb: 195,
    question: "\u041e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u043e\u043d\u043d\u0430\u044f \u0434\u0435\u044f\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u044c \u0443\u0447\u0438\u0442\u0435\u043b\u044f \u0441\u0432\u044f\u0437\u0430\u043d\u0430:",
    answer: "\u0441 \u0432\u043e\u0432\u043b\u0435\u0447\u0435\u043d\u0438\u0435\u043c \u0443\u0447\u0435\u043d\u0438\u043a\u043e\u0432 \u0432 \u0437\u0430\u043f\u043b\u0430\u043d\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u0443\u044e \u0440\u0430\u0431\u043e\u0442\u0443",
    options: ["\u0441 \u0432\u043e\u0432\u043b\u0435\u0447\u0435\u043d\u0438\u0435\u043c \u0443\u0447\u0435\u043d\u0438\u043a\u043e\u0432 \u0432 \u0437\u0430\u043f\u043b\u0430\u043d\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u0443\u044e \u0440\u0430\u0431\u043e\u0442\u0443", "\u0441 \u043f\u0440\u043e\u0446\u0435\u0441\u0441\u043e\u043c \u043f\u0435\u0440\u0435\u0434\u0430\u0447\u0438 \u0438\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0438\u0438 \u0434\u043b\u044f \u0443\u0447\u0435\u043d\u0438\u043a\u043e\u0432", "\u0441 \u043a\u043e\u043d\u0441\u0442\u0440\u0443\u0438\u0440\u043e\u0432\u0430\u043d\u0438\u0435\u043c \u043c\u043e\u0434\u0435\u043b\u0438 \u043f\u0440\u0435\u0434\u0441\u0442\u043e\u044f\u0449\u0435\u0439 \u0434\u0435\u044f\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u0438", "\u0441 \u0441\u043e\u0437\u0434\u0430\u043d\u0438\u0435\u043c \u0434\u0435\u0439\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0445 \u0441\u0442\u0438\u043c\u0443\u043b\u043e\u0432 \u0434\u043b\u044f \u043f\u0440\u043e\u0446\u0435\u0441\u0441\u0430 \u043e\u0431\u0443\u0447\u0435\u043d\u0438\u044f", "\u0441 \u043f\u0440\u043e\u0432\u0435\u0440\u043a\u043e\u0439 \u0437\u043d\u0430\u043d\u0438\u0439 \u0443\u0447\u0435\u043d\u0438\u043a\u043e\u0432"]
}
