    question: "\u0417\u0430\u043a\u043e\u043d\u043e\u043c\u0435\u0440\u043d\u043e\u0441\u0442\u0438  \u043e\u0431\u0443\u0447\u0435\u043d\u0438\u044f  \u0438  \u0432\u043e\u0441\u043f\u0438\u0442\u0430\u043d\u0438\u044f  \u0441\u043b\u0435\u043f\u044b\u0445  \u0438  \u0441\u043b\u0430\u0431\u043e\u0432\u0438\u0434\u044f\u0449\u0438\u0445  \u0434\u0435\u0442\u0435\u0439  \u0438 \t\n\u0432\u0437\u0440\u043e\u0441\u043b\u044b\u0445 \u0438\u0437\u0443\u0447\u0430\u0435\u0442:",
