    options: ["\u0442\u0438\u0444\u043b\u043e\u043f\u0435\u0434\u0430\u0433\u043e\u0433\u0438\u043a\u0430", "\u0441\u0443\u0440\u0434\u043e\u043f\u0435\u0434\u0430\u0433\u043e\u0433\u0438\u043a\u0430", "\u043b\u043e\u0433\u043e\u043f\u0435\u0434\u0438\u044f", "\u043e\u043b\u0438\u0433\u043e\u0444\u0440\u0435\u043d\u043e\u043f\u0435\u0434\u0430\u0433\u043e\u0433\u0438\u043a\u0430", "\u043b\u0435\u0447\u0435\u0431\u043d\u0430\u044f \u043f\u0435\u0434\u0430\u0433\u043e\u0433\u0438\u043a\u0430"]
