{
    numb: 201,
    question: "\u041a \u0441\u043e\u0432\u0440\u0435\u043c\u0435\u043d\u043d\u044b\u043c \u043c\u043e\u0434\u0435\u043b\u044f\u043c \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u0438 \u043e\u0431\u0443\u0447\u0435\u043d\u0438\u044f \u043e\u0442\u043d\u043e\u0441\u044f\u0442",
    answer: "\u043c\u043e\u0434\u0435\u043b\u0438 \u0441\u0438\u0441\u0442\u0435\u043c \u043f\u0440\u0438\u043d\u0446\u0438\u043f\u043e\u0432, \u0441\u0438\u0441\u0442\u0435\u043c \u043c\u0435\u0442\u043e\u0434\u043e\u0432, \u0444\u043e\u0440\u043c, \u0432\u0438\u0434\u043e\u0432 \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u0438",
    options: ["\u043c\u043e\u0434\u0435\u043b\u0438 \u0441\u0438\u0441\u0442\u0435\u043c \u043f\u0440\u0438\u043d\u0446\u0438\u043f\u043e\u0432, \u0441\u0438\u0441\u0442\u0435\u043c \u043c\u0435\u0442\u043e\u0434\u043e\u0432, \u0444\u043e\u0440\u043c, \u0432\u0438\u0434\u043e\u0432 \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u0438", "\u0442\u043e\u043b\u044c\u043a\u043e \u043c\u043e\u0434\u0435\u043b\u0438 \u0444\u043e\u0440\u043c \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u0438 \u043e\u0431\u0443\u0447\u0435\u043d\u0438\u044f", "\u043c\u043e\u0434\u0435\u043b\u0438 \u0444\u043e\u0440\u043c \u0438 \u043c\u0435\u0442\u043e\u0434\u043e\u0432 \t\u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u0438 \u043e\u0431\u0443\u0447\u0435\u043d\u0438\u044f.", "\u043c\u043e\u0434\u0435\u043b\u0438 \u0432\u0438\u0434\u043e\u0432 \u0438 \u0444\u043e\u0440\u043c \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u0438 \u043e\u0431\u0443\u0447\u0435\u043d\u0438\u044f.", "\u043c\u043e\u0434\u0435\u043b\u0438 \u0432\u0438\u0434\u043e\u0432 \u0438 \u0444\u043e\u0440\u043c \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u0438 \u0432\u043e\u0441\u043f\u0438\u0442\u0430\u043d\u0438\u044f"]
}
,
{
    numb: 202,
    question: "\u0412  \u043e\u0441\u043d\u043e\u0432\u0443  \u043f\u0440\u0438\u043d\u0446\u0438\u043f\u0430  \u0441\u043e\u0437\u043d\u0430\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u0438  \u0438  \u0430\u043a\u0442\u0438\u0432\u043d\u043e\u0441\u0442\u0438  \u043f\u043e  \u0442\u0440\u0430\u0434\u0438\u0446\u0438\u043e\u043d\u043d\u043e\u0439  \u043f\u0435\u0434\u0430\u0433\u043e\u0433\u0438\u043a\u0435 \t\n\u043f\u043e\u043b\u043e\u0436\u0435\u043d\u044b:",
    answer: "\u0443\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044b\u0435  \u043d\u0430\u0443\u043a\u043e\u0439 \t\u0437\u0430\u043a\u043e\u043d\u043e\u043c\u0435\u0440\u043d\u044b\u0435  \u043f\u043e\u043b\u043e\u0436\u0435\u043d\u0438\u044f:  \u043e\u0441\u043c\u044b\u0441\u043b\u0435\u043d\u043d\u044b\u0435  \u0437\u043d\u0430\u043d\u0438\u044f,  \u043c\u043e\u0442\u0438\u0432\u044b, \t\n\u0443\u0440\u043e\u0432\u043d\u0438  \u0438  \u0445\u0430\u0440\u0430\u043a\u0442\u0435\u0440  \u043f\u043e\u0437\u043d\u0430\u0432\u0430\u0442\u0435\u043b\u044c\u043d\u043e\u0439  \u0430\u043a\u0442\u0438\u0432\u043d\u043e\u0441\u0442\u0438,  \u0443\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u0439  \u0438  \u043f\u0440\u0438\u043c\u0435\u043d\u0435\u043d\u0438\u044f  \u043c\u0435\u0442\u043e\u0434\u043e\u0432  \u0438 \n\u0441\u0440\u0435\u0434\u0441\u0442\u0432",
    options: ["\u0443\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044b\u0435  \u043d\u0430\u0443\u043a\u043e\u0439 \t\u0437\u0430\u043a\u043e\u043d\u043e\u043c\u0435\u0440\u043d\u044b\u0435  \u043f\u043e\u043b\u043e\u0436\u0435\u043d\u0438\u044f:  \u043e\u0441\u043c\u044b\u0441\u043b\u0435\u043d\u043d\u044b\u0435  \u0437\u043d\u0430\u043d\u0438\u044f,  \u043c\u043e\u0442\u0438\u0432\u044b, \t\n\u0443\u0440\u043e\u0432\u043d\u0438  \u0438  \u0445\u0430\u0440\u0430\u043a\u0442\u0435\u0440  \u043f\u043e\u0437\u043d\u0430\u0432\u0430\u0442\u0435\u043b\u044c\u043d\u043e\u0439  \u0430\u043a\u0442\u0438\u0432\u043d\u043e\u0441\u0442\u0438,  \u0443\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u0439  \u0438  \u043f\u0440\u0438\u043c\u0435\u043d\u0435\u043d\u0438\u044f  \u043c\u0435\u0442\u043e\u0434\u043e\u0432  \u0438 \n\u0441\u0440\u0435\u0434\u0441\u0442\u0432", "\u0442\u0435\u043e\u0440\u0435\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0435  \u043f\u043e\u0438\u0441\u043a\u0438  \u0443\u0447\u0435\u043d\u044b\u0445  \u0438  \u043f\u0440\u0430\u043a\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0439  \u043e\u043f\u044b\u0442  \u043c\u043d\u043e\u0433\u0438\u0445  \u043f\u043e\u043a\u043e\u043b\u0435\u043d\u0438\u0439  \u0443\u0447\u0438\u0442\u0435\u043b\u0435\u0439 \t\n\u043f\u043e \u043e\u0431\u0435\u0441\u043f\u0435\u0447\u0435\u043d\u0438\u044e \u043f\u0440\u043e\u0447\u043d\u043e\u0433\u043e \u0443\u0441\u0432\u043e\u0435\u043d\u0438\u044f \u0437\t\u043d\u0430\u043d\u0438\u044f", "\u0437\u0430\u043a\u043e\u043d  \u0442\u0435\u0437\u0430\u0443\u0440\u0443\u0441\u0430:  \u0434\u043e\u0441\u0442\u0443\u043f\u043d\u044b\u043c  \u0434\u043b\u044f  \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430  \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f  \u0442\u043e,    \u0447\u0442\u043e  \u0441\u043e\u043e\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0443\u0435\u0442 \t\n\u0442\u0435\u0437\u0430\u0443\u0440\u0443\u0441\u0443 (\u0441\u043e\u043a\u0440\u043e\u0432\u0438\u0449\u0435)", "\u043f\u043e\u043b\u043e\u0436\u0435\u043d\u0438\u0435  \u043e  \u0442\u043e\u043c,  \u0447\u0442\u043e  \u0447\u0435\u043b\u043e\u0432\u0435\u043a  \u043e\u0431\u043b\u0430\u0434\u0430\u0435\u0442  \u043d\u0430\u0441\u0442\u043e\u044f\u0449\u0438\u043c  \u0437\u043d\u0430\u043d\u0438\u0435\u043c  \u0442\u043e\u0433\u0434\u0430  \u043a\u043e\u0433\u0434\u0430  \u0432  \u043c\u043e\u0437\u0433\u0443 \t\n\u043e\u0442\u0440\u0430\u0436\u0430\u0435\u0442\u0441\u044f \u0447\u0435\u0442\u043a\u0430\u044f \u043a\u0430\u0440\u0442\u0438\u043d\u0430 \u043c\u0438\u0440\u0430", "\u043f\u043e\u043b\u043e\u0436\u0435\u043d\u0438\u0435  \u043e  \u0442\u043e\u043c,  \u0447\u0442\u043e  \u0443\t\u0447\u0430\u0449\u0438\u043c\u0441\u044f  \u043d\u0430  \u043a\u0430\u0436\u0434\u043e\u043c  \u0448\u0430\u0433\u0443  \u043e\u0431\u0443\u0447\u0435\u043d\u0438\u044f  \u043f\u0440\u0435\u0434\u043b\u0430\u0433\u0430\u044e\u0442\u0441\u044f  \u0434\u043b\u044f \t\n\u0443\u0441\u0432\u043e\u0435\u043d\u0438\u044f \u043f\u043e\u0434\u043b\u0438\u043d\u043d\u044b\u0435 \u0437\u043d\u0430\u043d\u0438\u044f"]
}
,
{
    numb: 203,
    question: "\u0420\u0435\u0430\u043b\u0438\u0437\u0430\u0446\u0438\u044f \u043f\u0440\u0438\u043d\u0446\u0438\u043f\u0430 \u043e\u0431\u044a\u0435\u043a\u0442\u0438\u0432\u043d\u043e\u0441\u0442\u0438, \u0434\u043e\u0441\u0442\u043e\u0432\u0435\u0440\u043d\u043e\u0441\u0442\u0438 \u0438 \u0432\u0430\u043b\u0438\u0434\u043d\u043e\u0441\u0442\u0438 \t \t\n                   \t\u043f\u0440\u0435\u0434\u043f\u043e\u043b\u0430\u0433\u0430\u0435\u0442:",
    answer: "\u0447\u0451\u0442\u043a\u043e\u0435 \u043f\u043e\u043d\u0438\u043c\u0430\u043d\u0438\u0435 \u0438 \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u0435\u043d\u0438\u0435 \u0442\u043e\u0433\u043e, \u0447\u0442\u043e \t\u043f\u0440\u0435\u0434\u043f\u043e\u043b\u0430\u0433\u0430\u0435\u0442\u0441\u044f \u043e\u0446\u0435\u043d\u0438\u0442\u044c",
    options: ["\u0447\u0451\u0442\u043a\u043e\u0435 \u043f\u043e\u043d\u0438\u043c\u0430\u043d\u0438\u0435 \u0438 \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u0435\u043d\u0438\u0435 \u0442\u043e\u0433\u043e, \u0447\u0442\u043e \t\u043f\u0440\u0435\u0434\u043f\u043e\u043b\u0430\u0433\u0430\u0435\u0442\u0441\u044f \u043e\u0446\u0435\u043d\u0438\u0442\u044c", "\u0447\u0442\u043e \u0446\u0435\u043b\u0438 \u0438 \u043f\u0440\u043e\u0446\u0435\u0434\u0443\u0440\u044b \u0432 \u043e\u0446\u0435\u043d\u0438\u0432\u0430\u043d\u0438\u0438 \u0434\u043e\u043b\u0436\u043d\u044b \u0431\u044b\u0442\u044c \u043f\u043e\u043d\u044f\u0442\u043d\u044b\u043c\u0438", "\u0443\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u0435 \u0433\u0440\u0430\u0444\u0438\u043a\u0430 \u0441\u0443\u043c\u043c\u0430\u0442\u0438\u0432\u043d\u043e\u0433\u043e \u043e\u0446\u0435\u043d\u0438\u0432\u0430\u043d\u0438\u044f", "\u0438\u043d\u0438\u0446\u0438\u0438\u0440\u043e\u0432\u0430\u043d\u0438\u0435  \u043d\u0430\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u044f  \u0440\u0430\u0437\u0432\u0438\u0442\u0438\u044f  \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u0438\u044f,  \u0448\u043a\u043e\u043b\u044b,  \u0443\u0447\u0438\u0442\u0435\u043b\u0435\u0439  \u0438 \n\u043e\u0431\u0443\u0447\u0430\u044e\u0449\u0438\u0445\u0441\u044f", "\u043e\u043f\u0440\u0435\u0434\u0435\u043b\u0435\u043d\u0438\u0435 \u043d\u0430\u043f\t\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u044f \u0440\u0430\u0437\u0432\u0438\u0442\u0438\u044f \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u0438\u044f, \u0448\u043a\u043e\u043b\u044b, \u0443\u0447\u0438\u0442\u0435\u043b\u0435\u0439 \u0438 \u043e\u0431\u0443\u0447\u0430\u044e\u0449\u0438\u0445\u0441\u044f"]
}
,
{
    numb: 204,
    question: "\u041a\u043e\u043c\u043f\u0435\u0442\u0435\u043d\u0442\u043d\u043e\u0441\u0442\u043d\u044b\u0439 \u043f\u043e\u0434\u0445\u043e\u0434 \u043e\u0440\u0438\u0435\u043d\u0442\u0438\u0440\u043e\u0432\u0430\u043d \u043d\u0430:",
    answer: "\u043d\u043e\u0432\u043e\u0435 \u0432\u0438\u0434\u0435\u043d\u0438\u0435 \u0446\u0435\u043b\u0435\u0439 \u0438 \u043e\u0446\u0435\u043d\u043a\u0443 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u043e\u0432 \u043f\u0440\u043e\u0444\u0435\u0441\u0441\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u0438\u044f",
    options: ["\u043d\u043e\u0432\u043e\u0435 \u0432\u0438\u0434\u0435\u043d\u0438\u0435 \u0446\u0435\u043b\u0435\u0439 \u0438 \u043e\u0446\u0435\u043d\u043a\u0443 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u043e\u0432 \u043f\u0440\u043e\u0444\u0435\u0441\u0441\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u0438\u044f", "\u0438\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u043d\u0438\u0435  \u0432  \u0442\u0435\u043e\u0440\u0438\u0438  \u043e\u0431\u0443\u0447\u0435\u043d\u0438\u044f  \u044f\u0437\u044b\u043a\u0430\u043c  \u0440\u0430\u0437\u043d\u044b\u0445  \u0432\u0438\u0434\u043e\u0432 \t\n\u044f\u0437\u044b\u043a\u043e\u0432\u043e\u0439\/\u043a\u043e\u043c\u043c\u0443\u043d\u0438\u043a\u0430\u0442\u0438\u0432\u043d\u043e\u0439 \u043a\u043e\u043c\u043f\u0435\u0442\u0435\u043d\u0446\u0438\u0438", "\u0441\u043e\u0437\u0434\u0430\u043d\u0438\u0435 \u043f\u0440\u0435\u0434\u043f\u043e\u0441\u044b\u043b\u043e\u043a \u0440\u0430\u0437\u0433\u0440\u0430\u043d\u0438\u0447\u0435\u043d\u0438\u044f \u043f\u043e\u043d\u044f\u0442\u0438\u0439 \u00ab\u043a\u043e\u043c\u043f\u0435\u0442\u0435\u043d\u0446\u0438\u044f\/\u043a\u043e\u043c\u043f\u0435\u0442\u0435\u043d\u0442\u043d\u043e\u0441\u0442\u044c\u00bb", "\u0432\u0432\u0435\u0434\u0435\u043d\u0438\u0435 \u0432 \u043d\u0430\u0443\u0447\u043d\u044b\u0439 \u0430\u043f\u043f\u0430\u0440\u0430\u0442 \u043a\u0430\u0442\u0435\u0433\u043e\u0440\u0438\u0438 \u00ab\u043a\u043e\u043c\u043f\u0435\u0442\u0435\u043d\u0446\u0438\u044f\u00bb", "\u043f\u0440\u043e\u0435\u043a\u0442\u0438\u0440\u043e\u0432\u0430\u043d\u0438\u0435 \u0438\t \u0440\u0435\u0430\u043b\u0438\u0437\u0430\u0446\u0438\u044e \u0438\u043d\u0442\u0435\u0440\u0430\u043a\u0442\u0438\u0432\u043d\u044b\u0445 \u0442\u0435\u0445\u043d\u043e\u043b\u043e\u0433\u0438\u0439 \u043e\u0431\u0443\u0447\u0435\u043d\u0438\u044f"]
}
,
{
    numb: 205,
    question: "\u041a\u043e\u043c\u043f\u0435\u0442\u0435\u043d\u0442\u043d\u043e\u0441\u0442\u043d\u044b\u0439 \u043f\u043e\u0434\u0445\u043e\u0434 \u043e\u0440\u0438\u0435\u043d\u0442\u0438\u0440\u043e\u0432\u0430\u043d \u043d\u0430:",
    answer: "\u0440\u0430\u0437\u0432\u0438\u0442\u0438\u0435  \u0443  \u043e\u0431\u0443\u0447\u0430\u044e\u0449\u0438\u0445\u0441\u044f  \u0442\u0430\u043a\u0438\u0445  \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0430\u043b\u044c\u043d\u044b\u0445  \u0441\u043f\u043e\u0441\u043e\u0431\u043d\u043e\u0441\u0442\u0435\u0439  \u0438  \u0433\u043e\u0442\u043e\u0432\u043d\u043e\u0441\u0442\u0435\u0439, \t\n\u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u0432\u043e\u0441\u0442\u0440\u0435\u0431\u043e\u0432\u0430\u043d\u044b \u0441\u043e\u0432\u0440\u0435\u043c\u0435\u043d\u043d\u044b\u043c \u0440\u044b\u043d\u043a\u043e\u043c \u0442\u0440\u0443\u0434\u0430",
    options: ["\u0440\u0430\u0437\u0432\u0438\u0442\u0438\u0435  \u0443  \u043e\u0431\u0443\u0447\u0430\u044e\u0449\u0438\u0445\u0441\u044f  \u0442\u0430\u043a\u0438\u0445  \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0430\u043b\u044c\u043d\u044b\u0445  \u0441\u043f\u043e\u0441\u043e\u0431\u043d\u043e\u0441\u0442\u0435\u0439  \u0438  \u0433\u043e\u0442\u043e\u0432\u043d\u043e\u0441\u0442\u0435\u0439, \t\n\u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u0432\u043e\u0441\u0442\u0440\u0435\u0431\u043e\u0432\u0430\u043d\u044b \u0441\u043e\u0432\u0440\u0435\u043c\u0435\u043d\u043d\u044b\u043c \u0440\u044b\u043d\u043a\u043e\u043c \u0442\u0440\u0443\u0434\u0430", "\u0438\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u043d\u0438\u0435  \u0432  \u0442\u0435\u043e\u0440\u0438\u0438\t \t\u043e\u0431\u0443\u0447\u0435\u043d\u0438\u044f  \u044f\u0437\u044b\u043a\u0430\u043c  \u0440\u0430\u0437\u043d\u044b\u0445  \u0432\u0438\u0434\u043e\u0432 \t \t\n\u044f\u0437\u044b\u043a\u043e\u0432\u043e\u0439\/\u043a\u043e\u043c\u043c\u0443\u043d\u0438\u043a\u0430\u0442\u0438\u0432\u043d\u043e\u0439 \u043a\u043e\u043c\u043f\u0435\u0442\u0435\u043d\u0446\u0438\u0438", "\u0441\u043e\u0437\u0434\u0430\u043d\u0438\u0435 \u043f\u0440\u0435\u0434\u043f\u043e\u0441\u044b\u043b\u043e\u043a \u0440\u0430\u0437\u0433\u0440\u0430\u043d\u0438\u0447\u0435\u043d\u0438\u044f \u043f\u043e\u043d\u044f\u0442\u0438\u0439 \u00ab\u043a\u043e\u043c\u043f\u0435\u0442\u0435\u043d\u0446\u0438\u044f\/\u043a\u043e\u043c\u043f\u0435\u0442\u0435\u043d\u0442\u043d\u043e\u0441\u0442\u044c\u00bb", "\u0432\u0432\u0435\u0434\u0435\u043d\u0438\u0435 \u0432 \u043d\u0430\u0443\u0447\u043d\u044b\u0439 \u0430\u043f\u043f\u0430\u0440\u0430\u0442 \u043a\u0430\u0442\u0435\u0433\u043e\u0440\u0438\u0438 \u00ab\u043a\u043e\u043c\u043f\u0435\u0442\u0435\u043d\u0446\u0438\u044f\u00bb", "\u043f\u0440\u043e\u0435\u043a\u0442\u0438\u0440\u043e\u0432\u0430\u043d\u0438\u0435 \u0438 \u0440\u0435\u0430\u043b\u0438\u0437\u0430\u0446\u0438\u044e \u0438\u043d\u0442\u0435\u0440\u0430\u043a\u0442\u0438\t\u0432\u043d\u044b\u0445 \u0442\u0435\u0445\u043d\u043e\u043b\u043e\u0433\u0438\u0439 \u043e\u0431\u0443\u0447\u0435\u043d\u0438\u044f"]
}
,
{
    numb: 206,
    question: "\u041a\u043e\u043c\u043f\u0435\u0442\u0435\u043d\u0442\u043d\t\u043e\u0441\u0442\u043d\u044b\u0439 \u043f\u043e\u0434\u0445\u043e\u0434 \u043e\u0440\u0438\u0435\u043d\u0442\u0438\u0440\u043e\u0432\u0430\u043d \u043d\u0430:",
    answer: "\u0440\u0430\u0437\u0440\u0430\u0431\u043e\u0442\u043a\u0443 \u0441\u043e\u0434\u0435\u0440\u0436\u0430\u043d\u0438\u044f \u043f\u043e\u043d\u044f\u0442\u0438\u044f \u00ab\u0441\u043e\u0446\u0438\u0430\u043b\u044c\u043d\u044b\u0435 \u043a\u043e\u043c\u043f\u0435\u0442\u0435\u043d\u0446\u0438\u0438\/\u043a\u043e\u043c\u043f\u0435\u0442\u0435\u043d\u0442\u043d\u043e\u0441\u0442\u0438\u00bb",
    options: ["\u0440\u0430\u0437\u0440\u0430\u0431\u043e\u0442\u043a\u0443 \u0441\u043e\u0434\u0435\u0440\u0436\u0430\u043d\u0438\u044f \u043f\u043e\u043d\u044f\u0442\u0438\u044f \u00ab\u0441\u043e\u0446\u0438\u0430\u043b\u044c\u043d\u044b\u0435 \u043a\u043e\u043c\u043f\u0435\u0442\u0435\u043d\u0446\u0438\u0438\/\u043a\u043e\u043c\u043f\u0435\u0442\u0435\u043d\u0442\u043d\u043e\u0441\u0442\u0438\u00bb", "\u0438\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u043d\u0438\u0435  \u0432  \u0442\u0435\u043e\u0440\u0438\u0438  \u043e\u0431\u0443\u0447\u0435\u043d\u0438\u044f  \u044f\u0437\u044b\u043a\u0430\u043c  \u0440\u0430\u0437\u043d\u044b\u0445  \u0432\u0438\u0434\u043e\u0432 \t \t\n\u044f\u0437\u044b\u043a\u043e\u0432\u043e\u0439\/\u043a\u043e\u043c\u043c\u0443\u043d\u0438\u043a\u0430\u0442\u0438\u0432\u043d\u043e\u0439 \u043a\u043e\u043c\u043f\u0435\u0442\u0435\u043d\u0446\u0438\u0438", "\u0441\u043e\u0437\u0434\u0430\u043d\u0438\u0435 \u043f\u0440\u0435\u0434\u043f\u043e\u0441\u044b\u043b\u043e\u043a \u0440\u0430\u0437\u0433\u0440\u0430\u043d\u0438\u0447\u0435\u043d\u0438\u044f \u043f\u043e\u043d\u044f\u0442\u0438\u0439 \u00ab\u043a\u043e\u043c\u043f\u0435\u0442\u0435\u043d\u0446\u0438\u044f\/\u043a\u043e\u043c\u043f\u0435\u0442\u0435\u043d\u0442\u043d\u043e\u0441\u0442\u044c\u00bb", "\u0432\u0432\u0435\u0434\u0435\u043d\u0438\u0435 \u0432 \u043d\u0430\u0443\u0447\u043d\u044b\u0439 \u0430\u043f\u043f\u0430\u0440\u0430\u0442 \u043a\u0430\u0442\u0435\u0433\u043e\u0440\u0438\u0438 \u00ab\u043a\u043e\u043c\u043f\u0435\u0442\u0435\u043d\u0446\u0438\u044f\u00bb", "\u043f\u0440\u043e\u0435\u043a\u0442\u0438\u0440\u043e\u0432\u0430\u043d\u0438\u0435 \u0438 \u0440\u0435\u0430\u043b\u0438\u0437\u0430\u0446\u0438\u044e \u0438\u043d\u0442\u0435\u0440\u0430\u043a\u0442\u0438\u0432\u043d\u044b\u0445 \u0442\u0435\u0445\u043d\u043e\u043b\u043e\u0433\u0438\u0439 \u043e\u0431\u0443\u0447\u0435\u043d\u0438\u044f"]
}
