{
    numb: 238,
    question: "\u041d\u0430\u0437\u043e\u0432\u0438\u0442\u0435 \u043e\u0442\u043b\u0438\u0447\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u0435 \u0447\u0435\u0440\u0442\u044b \u0432\u0430\u043b\u044c\u0434\u043e\u0440\u0444\u0441\u043a\u043e\u0439 \u043f\u0435\u0434\u0430\u0433\u043e\u0433\u0438\u043a\u0438:",
    answer: "\u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0438\u0435 \u0434\u043e\u043b\u0436\u043d\u043e\u0441\u0442\u0438 \u0434\u0438\u0440\u0435\u043a\u0442\u043e\u0440\u0430 (\u0441\u0430\u043c\u043e\u0443\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u0435 \u0443\u0447\u0438\u0442\u0435\u043b\u0435\u0439)\t, \u0441\u0442\u0440\u043e\u0433\u043e\u0439 \u0443\u0447\u0435\u0431\u043d\u043e\u0439 \t\n\u0438 \u0430\u0434\u043c\u0438\u043d\u0438\u0441\u0442\u0440\u0430\u0442\u0438\u0432\u043d\u043e\u0439 \u0440\u0435\u0433\u043b\u0430\u043c\u0435\u043d\u0442\u0430\u0446\u0438\u0438 \u00ab\u0441\u0432\u0435\u0440\u0445\u0443\u00bb\t, \u043a\u0430\u0442\u0435\u0433\u043e\u0440\u0438\u0439 (\u0440\u0430\u043d\u0433\u043e\u0432)  \u0438 \u0443\u0440\u0430\u0432\u043d\u0438\u043b\u043e\u0432\u043a\u0430 \u0432 \t\n\u0437\u0430\u0440\u0430\u0431\u043e\u0442\u043d\u043e\u0439 \u043f\u043b\u0430\u0442\u0435",
    options: ["\u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0438\u0435 \u0434\u043e\u043b\u0436\u043d\u043e\u0441\u0442\u0438 \u0434\u0438\u0440\u0435\u043a\u0442\u043e\u0440\u0430 (\u0441\u0430\u043c\u043e\u0443\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u0435 \u0443\u0447\u0438\u0442\u0435\u043b\u0435\u0439)\t, \u0441\u0442\u0440\u043e\u0433\u043e\u0439 \u0443\u0447\u0435\u0431\u043d\u043e\u0439 \t\n\u0438 \u0430\u0434\u043c\u0438\u043d\u0438\u0441\u0442\u0440\u0430\u0442\u0438\u0432\u043d\u043e\u0439 \u0440\u0435\u0433\u043b\u0430\u043c\u0435\u043d\u0442\u0430\u0446\u0438\u0438 \u00ab\u0441\u0432\u0435\u0440\u0445\u0443\u00bb\t, \u043a\u0430\u0442\u0435\u0433\u043e\u0440\u0438\u0439 (\u0440\u0430\u043d\u0433\u043e\u0432)  \u0438 \u0443\u0440\u0430\u0432\u043d\u0438\u043b\u043e\u0432\u043a\u0430 \u0432 \t\n\u0437\u0430\u0440\u0430\u0431\u043e\u0442\u043d\u043e\u0439 \u043f\u043b\u0430\u0442\u0435", "\u043f\u043e  \u043a\u0430\u0436\u0434\u043e\u0439  \u0443\u0447\u0435\u0431\t\u043d\u043e\u0439  \u0434\u0438\u0441\u0446\u0438\u043f\u043b\u0438\u043d\u0435 \u0432\u0435\u0441\u044c \u0433\u043e\u0434\u043e\u0432\u043e\u0439  \u043a\u0443\u0440\u0441  \u0440\u0430\u0437\u0431\u0438\u0432\u0430\u0435\u0442\u0441\u044f \u043f\u043e  \u043c\u0435\u0441\u044f\u0446\u0430\u043c  \u0434\u043b\u044f \t\n\u043a\u0430\u0436\u0434\u043e\u0433\u043e \u043a\u043b\u0430\u0441\u0441\u0430", "\u0443\u0447\u0430\u0449\u0438\u0439\u0441\u044f \u0437\u043d\u0430\u043a\u043e\u043c\u0438\u0442\u0441\u044f \u0441 \u043f\u0440\u043e\u0433\u0440\u0430\u043c\u043c\u043e\u0439 \u043d\u0430 \u0433\u043e\u0434 \u043f\u043e \u043f\u0440\u0435\u0434\u043c\u0435\u0442\u0443", "\u0448\u043a\u043e\u043b\u044c\u043d\u0438\u043a\u0438 \u043f\u0440\u043e\u0445\u043e\u0434\u044f\u0442 \u0442\u0435\u0441\u0442\u0438\u0440\u043e\u0432\u0430\u043d\u0438\u0435 \u043d\u0430 \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u0435\u043d\u0438\u0435 \u043a\u043e\u044d\u0444\u0444\u0438\u0446\u0438\u0435\u043d\u0442\u0430 (\t IQ\t)", "\u043f\u0440\u0435\u0434\u043c\u0435\u0442\u043d\u044b\u0435 \u043b\u0430\u0431\u043e\u0440\u0430\u0442\u043e\u0440\u0438\u0438 \u0432\u043e\u0437\u0433\u043b\u0430\u0432\u043b\u044f\u044e\u0442\u0441\u044f\t \u0443\u0447\u0438\u0442\u0435\u043b\u044f\u043c\u0438 \t-\u043f\u0440\u0435\u0434\u043c\u0435\u0442\u043d\u0438\u043a\u0430\u043c\u0438"]
}
