    question: "\u0422\u0430\u043a\u0441\u043e\u043d\u043e\u043c\u0438\u044f \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u0442\u0435\u043b\u044c\u043d\u044b\u0445 \u0446\u0435\u043b\u0435\u0439 \t\u2013 \u044d\u0442\u043e :",
    answer: "\u0441\u0438\u0441\u0442\u0435\u043c\u0430  \u043f\u0435\u0434\u0430\u0433\u043e\u0433\u0438\u0447\u0435\u0441\u043a\u0438\u0445  \u0446\u0435\u043b\u0435\u0439,  \u0432\u043d\u0443\u0442\u0440\u0438  \u043a\u043e\u0442\u043e\u0440\u043e\u0439    \u0432\u044b\u0434\u0435\u043b\u0435\u043d\u044b  \u0438\u0445  \u043a\u0430\u0442\u0435\u0433\u043e\u0440\u0438\u0438  \u0438 \t\n\u043f\u043e\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u0442\u0435\u043b\u044c\u043d\u044b\u0435 \u0443\u0440\u043e\u0432\u043d\u0438",
