{
    numb: 251,
    question: "\u0414\u043b\u044f \u043f\u043e\u0434\u0434\u0435\u0440\u0436\u0430\u043d\u0438\u044f \u0438\u043d\u0442\u0435\u0440\u0435\u0441\u0430 \u043a \u043f\u043e\u0437\u043d\u0430\u0432\u0430\u0442\u0435\u043b\u044c\u043d\u043e\u0439 \u0434\u0435\u044f\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u0438 \u0432\u0430\u0436\u043d\u043e\u0435 \u0437\u043d\u0430\u0447\u0435\u043d\u0438\u0435 \t\n\u0438\u043c\u0435\u044e\u0442:",
    answer: "\u043f\u0440\u0435\u0434\u0443\u043f\u0440\u0435\u0436\u0434\u0435\u043d\u0438\u0435 \u043e\u0442\u0441\u0442\u0430\u0432\u0430\u043d\u0438\u044f \u0443\u0447\u0430\u0449\u0438\u0445\u0441\u044f",
    options: ["\u043f\u0440\u0435\u0434\u0443\u043f\u0440\u0435\u0436\u0434\u0435\u043d\u0438\u0435 \u043e\u0442\u0441\u0442\u0430\u0432\u0430\u043d\u0438\u044f \u0443\u0447\u0430\u0449\u0438\u0445\u0441\u044f", "\u043e\u0431\u0440\u0430\u0431\u043e\u0442\u043a\u0430 \u0434\u0430\u043d\u043d\u044b\u0445 \t\u043e\u0446\u0435\u043d\u0438\u0432\u0430\u043d\u0438\u044f", "\u043e\u0431\u0449\u0430\u044f \u0446\u0435\u043b\u044c \u0432\u043e\u0441\u043f\u0438\u0442\u0430\u043d\u0438\u044f", "\u043f\u0435\u0440\u0435\u0434\u0430\u0447\u0430 \u0434\u0430\u043d\u043d\u044b\u0445 \u043c\u043e\u043d\u0438\u0442\u043e\u0440\u0438\u043d\u0433\u0430", "\u0441\u043e\u0446\u0438\u0430\u043b\u044c\u043d\u044b\u0439 \u0437\u0430\u043a\u0430\u0437 \u043e\u0431\u0449\u0435\u0441\u0442\u0432\u0430"]
}
,
{
    numb: 252,
    question: "\u0414\u043b\u044f \u043f\u043e\u0434\u0434\u0435\u0440\u0436\u0430\u043d\u0438\u044f \u0438\u043d\u0442\u0435\u0440\u0435\u0441\u0430 \u043a \u043f\u043e\u0437\u043d\u0430\u0432\u0430\u0442\u0435\u043b\u044c\u043d\u043e\u0439 \u0434\u0435\u044f\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u0438 \u0432\u0430\u0436\u043d\u043e\u0435 \u0437\u043d\u0430\u0447\u0435\u043d\u0438\u0435 \t\n\u0438\u043c\u0435\u044e\u0442:",
    answer: "\u0434\u0438\u0430\u0433\u043d\u043e\u0441\u0442\u0438\u043a\u0430 \u00ab\u0434\u0435\u0442\u0435\u0439 \u0440\u0438\u0441\u043a\u0430\u00bb",
    options: ["\u0434\u0438\u0430\u0433\u043d\u043e\u0441\u0442\u0438\u043a\u0430 \u00ab\u0434\u0435\u0442\u0435\u0439 \u0440\u0438\u0441\u043a\u0430\u00bb", "\u043e\u0431\u0440\u0430\u0431\u043e\u0442\u043a\t\u0430 \u0434\u0430\u043d\u043d\u044b\u0445 \u043e\u0446\u0435\u043d\u0438\u0432\u0430\u043d\u0438\u044f", "\u043e\u0431\u0449\u0430\u044f \u0446\u0435\u043b\u044c \u0432\u043e\u0441\u043f\u0438\u0442\u0430\u043d\u0438\u044f", "\u0443\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u0435 \u0448\u043a\u043e\u043b\u043e\u0439", "\u0441\u043e\u0446\u0438\u0430\u043b\u044c\u043d\u044b\u0439 \u0437\u0430\u043a\u0430\u0437 \u043e\u0431\u0449\u0435\u0441\u0442\u0432\u0430"]
}
,
{
    numb: 253,
    question: "\u0414\u043b\u044f \u043f\u043e\u0434\u0434\u0435\u0440\u0436\u0430\u043d\u0438\u044f \u0438\u043d\u0442\u0435\u0440\u0435\u0441\u0430 \u043a \u043f\u043e\u0437\u043d\u0430\u0432\u0430\u0442\u0435\u043b\u044c\u043d\u043e\u0439 \u0434\u0435\u044f\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u0438 \u0432\u0430\u0436\u043d\u043e\u0435 \u0437\u043d\u0430\u0447\u0435\u043d\u0438\u0435 \t\n\u0438\u043c\u0435\u044e\u0442:",
    answer: "\u043e\u0431\u0435\u0441\u043f\u0435\u0447\u0435\u043d\u0438\u0435 \u0443\u0441\u043f\u0435\u0445\u0430 \u0432 \u0443\u0447\u0435\u043d\u0438\u0438",
    options: ["\u043e\u0431\u0435\u0441\u043f\u0435\u0447\u0435\u043d\u0438\u0435 \u0443\u0441\u043f\u0435\u0445\u0430 \u0432 \u0443\u0447\u0435\u043d\u0438\u0438", "\u043e\u0431\u0449\u0430\u044f \u0446\u0435\u043b\u044c \u0432\u043e\u0441\u043f\u0438\u0442\u0430\u043d\u0438\u044f", "\u0443\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u0435 \u0448\u043a\u043e\u043b\u043e\u0439", "\u043f\u0435\u0440\u0435\u0434\u0430\u0447\u0430 \u0434\u0430\u043d\u043d\u044b\u0445 \u043c\u043e\u043d\u0438\u0442\u043e\u0440\u0438\u043d\u0433\u0430", "\u0441\u043e\u0446\u0438\u0430\u043b\u044c\u043d\u044b\u0439 \u0437\u0430\u043a\u0430\u0437 \u043e\u0431\u0449\u0435\u0441\u0442\u0432\u0430"]
}
,
{
    numb: 254,
    question: "\u0421\u0442\u0440\u0443\u043a\u0442\u0443\u0440\u0430 \u0443\u0440\u043e\u043a\u0430 \t- \u044d\u0442\u043e:",
    answer: "\u0441\u043e\u0432\u043c\u0435\u0441\u0442\u043d\u0430\u044f \u0434\u0435\u044f\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u044c \u0443\u0447\u0438\u0442\u0435\u043b\u044f \u0438 \u0443\u0447\u0430\u0449\u0438\u0445\u0441\u044f, \u043d\u0430\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u043d\u0430\u044f \u043d\u0430 \u0440\u0430\u0437\u0440\u0435\u0448\u0435\u043d\u0438\u0435 \t\n\u043f\u0440\u043e\u0431\u043b\u0435\u043c \t\u0443\u0447\u0435\u0431\u043d\u043e\u0433\u043e \u043f\u0440\u043e\u0446\u0435\u0441\u0441\u0430",
    options: ["\u0441\u043e\u0432\u043c\u0435\u0441\u0442\u043d\u0430\u044f \u0434\u0435\u044f\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u044c \u0443\u0447\u0438\u0442\u0435\u043b\u044f \u0438 \u0443\u0447\u0430\u0449\u0438\u0445\u0441\u044f, \u043d\u0430\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u043d\u0430\u044f \u043d\u0430 \u0440\u0430\u0437\u0440\u0435\u0448\u0435\u043d\u0438\u0435 \t\n\u043f\u0440\u043e\u0431\u043b\u0435\u043c \t\u0443\u0447\u0435\u0431\u043d\u043e\u0433\u043e \u043f\u0440\u043e\u0446\u0435\u0441\u0441\u0430", "\u0432\u0437\u0430\u0438\u043c\u043e\u0441\u0432\u044f\u0437\u0430\u043d\u043d\u0430\u044f  \u0434\u0435\u044f\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u044c  \u0443\u0447\u0438\u0442\u0435\u043b\u044f  \u0438  \u0443\u0447\u0430\u0449\u0438\u0445\u0441\u044f,  \u043d\u0430\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u043d\u0430\u044f  \u043d\u0430 \t\n\u0434\u043e\u0441\u0442\u0438\u0436\u0435\u043d\u0438\u044f \u0446\u0435\u043b\u0438", "\u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u044f \u0443\u0447\u0435\u0431\u043d\u043e\t-\u043f\u043e\u0437\u043d\u0430\u0432\u0430\u0442\u0435\u043b\u044c\u043d\u043e\u0439 \u0434\u0435\u044f\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u0438 \u0443\u0447\u0430\u0449\u0438\u0445\u0441\u044f", "\u0441\u043e\t\u0432\u043e\u043a\u0443\u043f\u043d\u043e\u0441\u0442\u044c \u044d\u043b\u0435\u043c\u0435\u043d\u0442\u043e\u0432 \u0432\u043e\u0441\u043f\u0438\u0442\u0430\u0442\u0435\u043b\u044c\u043d\u043e\u0433\u043e \u043c\u0435\u0440\u043e\u043f\u0440\u0438\u044f\u0442\u0438\u044f, \u043e\u0431\u0435\u0441\u043f\u0435\u0447\u0438\u0432\u0430\u044e\u0449\u0430\u044f \u0435\u0433\u043e \t\n\u0446\u0435\u043b\t\u043e\u0441\u0442\u043d\u043e\u0441\u0442\u044c", "\u0441\u043e\u0432\u043e\u043a\u0443\u043f\u043d\u043e\u0441\u0442\u044c    \u044d\u043b\u0435\u043c\u0435\u043d\u0442\u043e\u0432  \u0443\u0440\u043e\u043a\u0430,  \u043e\u0431\u0435\u0441\u043f\u0435\u0447\u0438\u0432\u0430\u044e\u0449\u0438\u0435  \u0434\u0435\u044f\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u044c  \u0443\u0447\u0438\u0442\u0435\u043b\u044f  \u0438 \t\n\u0443\u0447\u0430\u0449\u0438\u0445\u0441\u044f"]
}
,
{
    numb: 255,
    question: "\u0421\u0442\u0440\u0443\u043a\u0442\u0443\u0440\u0430 \u0443\u0440\u043e\u043a\u0430 \t- \u044d\u0442\u043e:",
    answer: "\u0434\u0438\u0434\u0430\u043a\u0442\u0438\u0447\u0435\u0441\u043a\u0438  \u043e\u0431\u0443\u0441\u043b\u043e\u0432\u043b\u0435\u043d\u043d\u0430\u044f  \u0432\u043d\u0443\u0442\u0440\u0435\u043d\u043d\u044f\u044f  \u0432\u0437\u0430\u0438\u043c\u043e\u0441\u0432\u044f\u0437\u044c  \u043e\u0441\u043d\u043e\u0432\u043d\u044b\u0445  \u043a\u043e\u043c\u043f\u043e\u043d\u0435\u043d\u0442\u043e\u0432 \t\n\u0443\u0440\u043e\u043a\u0430, \u0438\u0445 \u0446\u0435\u043b\u0435\u043d\u0430\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u043d\u0430\u044f \u0443\u043f\u043e\u0440\u044f\u0434\u043e\u0447\u0435\u043d\u043d\u043e\u0441\u0442\u044c \u0438 \u0432\t\u0437\u0430\u0438\u043c\u043e\u0434\u0435\u0439\u0441\u0442\u0432\u0438\u0435",
    options: ["\u0434\u0438\u0434\u0430\u043a\u0442\u0438\u0447\u0435\u0441\u043a\u0438  \u043e\u0431\u0443\u0441\u043b\u043e\u0432\u043b\u0435\u043d\u043d\u0430\u044f  \u0432\u043d\u0443\u0442\u0440\u0435\u043d\u043d\u044f\u044f  \u0432\u0437\u0430\u0438\u043c\u043e\u0441\u0432\u044f\u0437\u044c  \u043e\u0441\u043d\u043e\u0432\u043d\u044b\u0445  \u043a\u043e\u043c\u043f\u043e\u043d\u0435\u043d\u0442\u043e\u0432 \t\n\u0443\u0440\u043e\u043a\u0430, \u0438\u0445 \u0446\u0435\u043b\u0435\u043d\u0430\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u043d\u0430\u044f \u0443\u043f\u043e\u0440\u044f\u0434\u043e\u0447\u0435\u043d\u043d\u043e\u0441\u0442\u044c \u0438 \u0432\t\u0437\u0430\u0438\u043c\u043e\u0434\u0435\u0439\u0441\u0442\u0432\u0438\u0435", "\u0432\u0437\u0430\u0438\u043c\u043e\u0441\u0432\u044f\u0437\u0430\u043d\u043d\u0430\u044f  \u0434\u0435\u044f\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u044c  \u0443\u0447\u0438\u0442\u0435\u043b\u044f  \u0438  \u0443\u0447\u0430\u0449\u0438\u0445\u0441\u044f,  \u043d\u0430\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u043d\u0430\u044f  \u043d\u0430 \t\n\u0434\u043e\u0441\u0442\u0438\u0436\u0435\u043d\u0438\u044f \u0446\u0435\u043b\u0438", "\u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u044f \u0443\u0447\u0435\u0431\u043d\u043e\t-\u043f\u043e\u0437\u043d\u0430\t\u0432\u0430\u0442\u0435\u043b\u044c\u043d\u043e\u0439 \u0434\u0435\u044f\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u0438 \u0443\u0447\u0430\u0449\u0438\u0445\u0441\u044f", "\u0441\u043e\u0432\u043c\u0435\u0441\u0442\u043d\u0430\u044f  \u0434\u0435\u044f\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u044c  \u0443\u0447\u0438\u0442\u0435\u043b\u044f  \u0438  \u0443\u0447\u0430\u0449\u0438\u0445\u0441\u044f,  \u043d\u0430\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u043d\u0430\u044f  \u043d\u0430 \t\u0440\u0430\u0437\u0440\u0435\u0448\u0435\u043d\u0438\u0435 \t\n\u043f\u0440\u043e\u0431\u043b\u0435\u043c \u0443\u0447\u0435\u0431\u043d\u043e\u0433\u043e \u043f\u0440\u043e\u0446\u0435\u0441\u0441\u0430", "\u0441\u043e\u0432\u043e\u043a\u0443\u043f\u043d\u043e\u0441\u0442\u044c \u044d\u043b\u0435\u043c\u0435\u043d\u0442\u043e\u0432 \u0432\u043e\u0441\u043f\u0438\u0442\u0430\u0442\u0435\u043b\u044c\u043d\u043e\u0433\u043e \u043c\u0435\u0440\u043e\u043f\u0440\u0438\u044f\u0442\u0438\u044f, \u043e\u0431\u0435\u0441\u043f\u0435\u0447\u0438\u0432\u0430\u044e\u0449\u0430\u044f \u0435\u0433\u043e \t\n\u0446\u0435\u043b\u043e\u0441\u0442\u043d\u043e\u0441\u0442\u044c"]
}
