{
    numb: 256,
    question: "\u041e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u0438\u0435 \u043a\u0430\u043a \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442 \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043b\u044f\u0435\u0442 \u0441\u043e\u0431\u043e\u0439:",
    answer: "\u0434\u043e\u0441\u0442\u0438\u0433\u043d\u0443\u0442\u044b\u0439 \u0443\u0440\u043e\u0432\u0435\u043d\u044c \u0432 \u043e\u0441\u0432\u043e\u0435\u043d\u0438\u0438 \u0437\u043d\u0430\u043d\u0438\u0439, \u0443\u043c\u0435\u043d\u0438\u0439, \t\u043d\u0430\u0432\u044b\u043a\u043e\u0432, \u043e\u043f\u044b\u0442\u0430 \u0434\u0435\u044f\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u0438 \u0438 \t\n\u043e\u0442\u043d\u043e\u0448\u0435\u043d\u0438\u0439",
    options: ["\u0434\u043e\u0441\u0442\u0438\u0433\u043d\u0443\u0442\u044b\u0439 \u0443\u0440\u043e\u0432\u0435\u043d\u044c \u0432 \u043e\u0441\u0432\u043e\u0435\u043d\u0438\u0438 \u0437\u043d\u0430\u043d\u0438\u0439, \u0443\u043c\u0435\u043d\u0438\u0439, \t\u043d\u0430\u0432\u044b\u043a\u043e\u0432, \u043e\u043f\u044b\u0442\u0430 \u0434\u0435\u044f\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u0438 \u0438 \t\n\u043e\u0442\u043d\u043e\u0448\u0435\u043d\u0438\u0439", "\u0441\u043e\u0432\u043e\u043a\u0443\u043f\u043d\u043e\u0441\u0442\u044c  \u043f\u0440\u0435\u0435\u043c\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0445  \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u0442\u0435\u043b\u044c\u043d\u044b\u0445  \u043f\u0440\u043e\u0433\u0440\u0430\u043c\u043c  \u0438  \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0445 \t\n\u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u0442\u0435\u043b\u044c\u043d\u044b\u0445 \u0441\u0442\u0430\u043d\u0434\u0430\u0440\u0442\u043e\u0432, \u0441\u0435\u0442\u044c \u0440\u0435\u0430\u043b\u0438\u0437\u0443\u044e\u0449\u0438\u0445 \u0438\u0445 \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u0442\u0435\u043b\u044c\u043d\u044b\u0445 \u0443\u0447\u0440\u0435\u0436\u0434\u0435\u043d\u0438\u0439, \u043e\u0440\u0433\u0430\u043d\u043e\u0432  \n\u0443\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u044f  \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u0438\u044f", "\u0441\u0442\u0440\u0443\u043a\u0442\u0443\u0440\u0443  \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\t\u0435\u043d\u043d\u043e\u0439  \u0432\u043b\u0430\u0441\u0442\u0438  \u043a\u0430\u043a  \u0441\u0430\u043c\u043e\u0441\u0442\u043e\u044f\u0442\u0435\u043b\u044c\u043d\u043e\u0435  \t\n\u043d\u0430\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u0435 \u0432 \u0440\u044f\u0434\u0443 \u0434\u0440\u0443\u0433\u0438\u0445 \u043e\u0442\u0440\u0430\u0441\u043b\u0435\u0439 \u043d\u0430\u0440\u043e\u0434\u043d\u043e\u0433\u043e \u0445\u043e\u0437\u044f\u0439\u0441\u0442\u0432\u0430", "\u0441\u043f\u0435\u0446\u0438\u0430\u043b\u044c\u043d\u043e \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u043e\u0432\u0430\u043d\u043d\u043e\u0435, \u0440\u0430\u0437\u0432\u0438\u0432\u0430\u044e\u0449\u0435\u0435\u0441\u044f \u0432\u043e \u0432\u0440\u0435\u043c\u0435\u043d\u0438 \u0438 \u0432 \u0440\u0430\u043c\u043a\u0430\u0445 \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u0451\u043d\u043d\u043e\u0439 \t\n\u0432\u043e\u0441\u043f\u0438\u0442\u0430\u0442\u0435\u043b\u044c\u043d\u043e\u0439 \u0441\u0438\u0441\u0442\u0435\u043c\u044b \u0432\u0437\u0430\u0438\u043c\u043e\u0434\u0435\u0439\u0441\u0442\u0432\u0438\u0435 \u0432\u043e\u0441\u043f\u0438\u0442\u0430\u0442\u0435\u043b\u0435\u0439 \u0438 \u0432\u043e\u0441\u043f\u0438\u0442\u0443\u0435\u043c\u044b\u0445", "\u043e\u0441\u0432\u043e\u0435\u043d\u0438\t\u0435 \u0432 \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u0442\u0435\u043b\u044c\u043d\u044b\u0445 \u0443\u0447\u0440\u0435\u0436\u0434\u0435\u043d\u0438\u044f\u0445, \u0430 \u0442\u0430\u043a\u0436\u0435 \u0432 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u0435 \u0441\u0430\u043c\u043e\u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u0438\u044f \t\n\u0441\u0438\u0441\u0442\u0435\u043c\u044b \u0437\u043d\u0430\u043d\u0438\u0439\t, \u0443\u043c\u0435\u043d\u0438\u0439, \u043d\u0430\u0432\u044b\u043a\u043e\u0432, \u043e\u043f\u044b\u0442\u0430  \u0434\u0435\u044f\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u0438 \u0438 \u043e\u0442\u043d\u043e\u0448\u0435\u043d\u0438\u0439"]
}
