{
    numb: 257,
    question: "\u041a \u043e\u0441\u043e\u0431\u0435\u043d\u043d\u043e\u0441\u0442\u044f\u043c \u043f\u043e\u0434\u0440\u043e\u0441\u0442\u043a\u043e\u0432\u043e\u0433\u043e \u0432\u043e\u0437\u0440\u0430\u0441\u0442\u0430 \u043d\u0435 \u043e\u0442\u043d\u043e\u0441\u0438\u0442\u0441\u044f:",
    answer: "\u043d\u0435\t \u0443\u043c\u0435\u044e\u0442  \u0441\u0434\u0435\u0440\u0436\u0438\u0432\u0430\u0442\u044c  \u0441\u0432\u043e\u0438  \u0447\u0443\u0432\u0441\u0442\u0432\u0430, \t\u043a\u043e\u043d\u0442\u0440\u043e\u043b\u0438\u0440\u043e\u0432\u0430\u0442\u044c  \u0438\u0445 \u0432\u043d\u0435\u0448\u043d\u0435\u0435  \u043f\u0440\u043e\u044f\u0432\u043b\u0435\u043d\u0438\u0435,  \u043e\u043d\u0438 \t\n\u043e\u0447\u0435\u043d\u044c \u043d\u0435\u043f\u043e\u0441\u0440\u0435\u0434\u0441\u0442\u0432\u0435\u043d\u043d\u044b \u0438\t \u043e\u0442\u043a\u0440\u043e\u0432\u0435\u043d\u043d\u044b \u0432\t \u0432\u044b\u0440\u0430\u0436\u0435\u043d\u0438\u0438 \u0440\u0430\u0434\u043e\u0441\u0442\u0438",
    options: ["\u043d\u0435\t \u0443\u043c\u0435\u044e\u0442  \u0441\u0434\u0435\u0440\u0436\u0438\u0432\u0430\u0442\u044c  \u0441\u0432\u043e\u0438  \u0447\u0443\u0432\u0441\u0442\u0432\u0430, \t\u043a\u043e\u043d\u0442\u0440\u043e\u043b\u0438\u0440\u043e\u0432\u0430\u0442\u044c  \u0438\u0445 \u0432\u043d\u0435\u0448\u043d\u0435\u0435  \u043f\u0440\u043e\u044f\u0432\u043b\u0435\u043d\u0438\u0435,  \u043e\u043d\u0438 \t\n\u043e\u0447\u0435\u043d\u044c \u043d\u0435\u043f\u043e\u0441\u0440\u0435\u0434\u0441\u0442\u0432\u0435\u043d\u043d\u044b \u0438\t \u043e\u0442\u043a\u0440\u043e\u0432\u0435\u043d\u043d\u044b \u0432\t \u0432\u044b\u0440\u0430\u0436\u0435\u043d\u0438\u0438 \u0440\u0430\u0434\u043e\u0441\u0442\u0438", "\u043f\u043e\u044f\u0432\u043b\u044f\u044e\u0442\u0441\u044f  \u0441\u043f\u043e\u0441\u043e\u0431\u043d\u043e\u0441\u0442\u0438  \u043b\u043e\u0433\u0438\u0447\u0435\u0441\u043a\u0438  \u043c\u044b\u0441\u043b\u0438\u0442\u044c,  \u043e\u043f\u0435\u0440\u0438\u0440\u043e\u0432\u0430\u0442\u044c  \u0430\u0431\u0441\u0442\u0440\u0430\u043a\u0442\u043d\u044b\u043c\u0438 \t\n\u043a\u0430\u0442\u0435\u0433\u043e\u0440\u0438\u044f\u043c\u0438, \u0444\u0430\u043d\u0442\u0430\u0437\u0438\u0440\u043e\u0432\u0430\u0442\u044c", "\u043e\u0431\u0449\u0435\u043d\u0438\u0435 \u0441\u043e \u0441\u0432\u0435\u0440\u0441\u0442\u043d\u0438\u043a\u0430\u043c\u0438 \u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u0441\u044f \u043d\u0435\u043e\u0431\u0445\u043e\u0434\u0438\u043c\u043e\u0441\u0442\t\u044c\u044e", "\u043e\u0431\u0449\u0435\u043d\u0438\u0435 \u0441 \u0440\u043e\u0434\u0438\u0442\u0435\u043b\u044f\u043c\u0438 \u0438 \u0440\u043e\u0434\u0441\u0442\u0432\u0435\u043d\u043d\u0438\u043a\u0430\u043c\u0438 \u0443\u0445\u043e\u0434\u0438\u0442 \u043d\u0430 \u0432\u0442\u043e\u0440\u043e\u0439 \u043f\u043b\u0430\u043d", "\u0444\u043e\u0440\u043c\u0438\u0440\u0443\u0435\u0442\u0441\u044f \u0441\u0430\u043c\u043e\u043e\u0446\u0435\u043d\u043a\u0430 \u0440\u0435\u0431\u0435\u043d\u043a\u0430, \u0441\u043f\u043e\u0441\u043e\u0431\u043d\u043e\u0441\u0442\u044c \u043f\u0440\u0438\u043d\u044f\u0442\u044c \u043a\u0430\u043a \u0441\u0432\u043e\u0438 \u043f\u043e\u043b\u043e\u0436\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u0435, \t\n\u0442\u0430\u043a \u0438 \u043e\u0442\u0440\u0438\u0446\u0430\u0442\u0435\u043b\u044c\u043d\u044b\u0435 \u0447\u0435\u0440\u0442\u044b"]
}
