{
    numb: 278,
    question: "\u0421\u0443\u0442\u044c \u043f\u0440\u0438\u043d\u0446\u0438\u043f\u0430 \u0431\u0435\u0437\u043e\u0442\u043b\u0430\u0433\u0430\u0442\u0435\u043b\u044c\u043d\u043e\u0439 \u0438 \u043d\u0435\u043f\u0440\u0435\u0440\u044b\u0432\u043d\u043e\u0439 \u043f\u0435\u0440\u0435\u0434\u0430\u0447\u0438 \u0437\u043d\u0430\u043d\u0438\u0439:",
    answer: "\u043a\u0430\u0436\u0434\u044b\u0439 \u0443\u0447\u0435\u043d\u0438\u043a \u0434\u043e\u043b\u0436\u0435\u043d \u0438\u0437\u0443\u0447\u0430\u0442\u044c \u043d\u043e\u0432\u0443\u044e \u0442\u0435\u043c\u0443, \u043f\u0440\u043e\u0432\u0435\u0440\u044f\u044f \u0438 \u0437\u0430\u043a\u0440\u0435\u043f\u043b\u044f\u044f \u0441\u0442\u043e\u043b\u044c\u043a\u043e \u0440\u0430\u0437, \t\n\u0441\u043a\u043e\u043b\u044c\u043a\u043e \u043d\u0435\u043e\u0431\u0445\u043e\u0434\u0438\u043c\u043e \u0434\u043b\t\u044f \u043f\u0440\u043e\u0447\u043d\u043e\u0433\u043e \u043e\u0432\u043b\u0430\u0434\u0435\u043d\u0438\u044f \u0435\u044e",
    options: ["\u043a\u0430\u0436\u0434\u044b\u0439 \u0443\u0447\u0435\u043d\u0438\u043a \u0434\u043e\u043b\u0436\u0435\u043d \u0438\u0437\u0443\u0447\u0430\u0442\u044c \u043d\u043e\u0432\u0443\u044e \u0442\u0435\u043c\u0443, \u043f\u0440\u043e\u0432\u0435\u0440\u044f\u044f \u0438 \u0437\u0430\u043a\u0440\u0435\u043f\u043b\u044f\u044f \u0441\u0442\u043e\u043b\u044c\u043a\u043e \u0440\u0430\u0437, \t\n\u0441\u043a\u043e\u043b\u044c\u043a\u043e \u043d\u0435\u043e\u0431\u0445\u043e\u0434\u0438\u043c\u043e \u0434\u043b\t\u044f \u043f\u0440\u043e\u0447\u043d\u043e\u0433\u043e \u043e\u0432\u043b\u0430\u0434\u0435\u043d\u0438\u044f \u0435\u044e", "\u0443\u0447\u0430\u0449\u0438\u0435\u0441\u044f \u043a\u043b\u0430\u0441\u0441\u0430 \u0434\u043e\u043b\u0436\u043d\u044b \u043e\u0434\u043d\u043e\u0432\u0440\u0435\u043c\u0435\u043d\u043d\u043e \u0438\u0437\u0443\u0447\u0430\u0442\u044c \u043d\u0435 \u043e\u0434\u043d\u0443 \u0438 \u0442\u0443 \u0442\u0435\u043c\u0443, \u0430 \u0440\u0430\u0437\u043d\u044b\u0435 \t\n\u0442\u0435\u043c\u044b, \u0438\u043c\u0435\u0442\u044c \u0440\u0430\u0437\u043d\u044b\u0435 \u0437\u0430\u0434\u0430\u043d\u0438\u044f", "\u0432\u0441\u0435\u043e\u0431\u0449\u0435\u0435 \u0441\u043e\u0442\u0440\u0443\u0434\u043d\u0438\u0447\u0435\u0441\u0442\u0432\u043e \u0438 \u0442\u043e\u0432\u0430\u0440\u0438\u0449\u0435\u0441\u043a\u0430\u044f \u0432\u0437\u0430\u0438\u043c\u043e\u043f\u043e\u043c\u043e\u0449\u044c", "\u043d\u0435\u043e\u0431\u0445\u043e\u0434\u0438\u043c\u043e\u0441\u0442\u044c \u043e\u0431\u044a\u0435\u0434\u0438\u043d\u0435\u043d\u0438\u044f \u0432 \u043e\u0434\u0438\u043d \t\u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u0442\u0435\u043b\u044c\u043d\u044b\u0439 \u043a\u043e\u043b\u043b\u0435\u043a\u0442\u0438\u0432 \u0443\u0447\u0430\u0449\u0438\u0445\u0441\u044f \t\n\u0440\u0430\u0437\u043d\u043e\u0433\u043e \u0432\u043e\u0437\u0440\u0430\u0441\u0442\u0430 \u0438 \u0440\u0430\u0437\u043d\u043e\u0433\u043e \u0443\u0440\u043e\u0432\u043d\u044f", "\u043e\u0431\u0443\u0447\u0435\u043d\u0438\u0435 \u0437\u0430\u0432\u0435\u0440\u0448\u0430\u0435\u0442\u0441\u044f \u0442\u043e\u0433\u0434\u0430, \u043a\u043e\u0433\u0434\u0430 \u043e\u0431\u0443\u0447\u0430\u0435\u043c\u044b\u0439 \u043c\u043e\u0436\u0435\u0442 \u0442\u043e\u043c\u0443, \u0447\u0435\u043c\u0443 \u0435\u0433\u043e \u0443\u0447\u0438\u043b\u0438, \u0443\u0447\u0438\u0442\u044c \t\n\u0434\u0440\u0443\u0433\u0438\u0445 \u0431\u0435\u0437 \u043f\u043e\u0442\u0435\u0440\u044c \u0438 \u0438\u0441\u043a\u0430\u0436\u0435\u043d\u0438\u0439"]
}
