{
    numb: 299,
    question: "\u041e\u0441\u043d\u043e\u0432\u043d\u044b\u0435 \u0437\u0430\u043a\u043e\u043d\u043e\u043c\u0435\u0440\u043d\u043e\u0441\u0442\u0438 \u0434\u0443\u0445\u043e\u0432\u043d\u043e\u0433\u043e \u0440\u0430\u0437\u0432\u0438\u0442\u0438\u044f",
    answer: "\u0441\u0442\u0435\u043f\u0435\u043d\u044c \u0434\u0443\u0445\u043e\u0432\u043d\u043e\u0433\u043e  \u0440\u0430\u0437\u0432\t\u0438\u0442\u0438\u044f \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430 \u0434\u0435\u0442\u0435\u0440\u043c\u0438\u043d\u0438\u0440\u0443\u0435\u0442\u0441\u044f  \u0448\u0438\u0440\u043e\u0442\u043e\u0439 \u0435\u0433\u043e \u0432\u043d\u0435\u0448\u043d\u0438\u0445 \t\n\u0441\u0432\u044f\u0437\u0435\u0439 \u0438 \u043e\u0442\u043d\u043e\u0448\u0435\u043d\u0438\u0439, \u043c\u043d\u043e\u0433\u043e\u043e\u0431\u0440\u0430\u0437\u0438\u0435\u043c     \u0434\u0435\u044f\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u0438",
    options: ["\u0441\u0442\u0435\u043f\u0435\u043d\u044c \u0434\u0443\u0445\u043e\u0432\u043d\u043e\u0433\u043e  \u0440\u0430\u0437\u0432\t\u0438\u0442\u0438\u044f \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430 \u0434\u0435\u0442\u0435\u0440\u043c\u0438\u043d\u0438\u0440\u0443\u0435\u0442\u0441\u044f  \u0448\u0438\u0440\u043e\u0442\u043e\u0439 \u0435\u0433\u043e \u0432\u043d\u0435\u0448\u043d\u0438\u0445 \t\n\u0441\u0432\u044f\u0437\u0435\u0439 \u0438 \u043e\u0442\u043d\u043e\u0448\u0435\u043d\u0438\u0439, \u043c\u043d\u043e\u0433\u043e\u043e\u0431\u0440\u0430\u0437\u0438\u0435\u043c     \u0434\u0435\u044f\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u0438", "\u043f\u043e \u043c\u0435\u0440\u0435 \u0432\u0437\u0440\u043e\u0441\u043b\u0435\u043d\u0438\u044f \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430 \u0442\u0435\u043c\u043f \u0435\u0433\u043e \u0434\u0443\u0445\u043e\u0432\u043d\u043e\u0433\u043e \u0440\u0430\u0437\u0432\u0438\u0442\u0438\u044f \u0437\u0430\u043c\u0435\u0434\u043b\u044f\u0435\u0442\u0441\u044f", "\u043e\u0431\u0443\u0447\u0435\u043d\u0438\u0435 \u043f\u043e \u0435\u0434\u0438\u043d\u043e\u043c\u0443 \u0443\u0447\u0435\u0431\u043d\u043e\u043c\u0443 \u043f\u043b\u0430\u043d\u0443 \u0438 \u0435\u0434\u0438\u043d\u044b\u043c \u0443\u0447\u0435\u0431\u043d\u044b\u043c \u043f\u0440\u043e\u0433\u0440\u0430\u043c\u043c\u0430\u043c", "\u043f\u043b\u0430\u043d\u0438\u0440\u043e\u0432\u0430\u043d\u0438\u0435, \u043e\u0440\u0433\u0430\u043d\t\u0438\u0437\u0430\u0446\u0438\u044f \u0438 \u0432\u0435\u0434\u0435\u043d\u0438\u0435 \u0443\u0440\u043e\u043a\u0430 \u0443\u0447\u0438\u0442\u0435\u043b\u0435\u043c", "\u0440\u0430\u0437\u0432\u0438\u0442\u0438\u0435 \u0432\u043e\u043b\u0435\u0432\u044b\u0445 \u0438 \u0441\u043f\u043e\u0440\u0442\u0438\u0432\u043d\u043e\t-\u0444\u0438\u0437\u0438\u0447\u0435\u0441\u043a\u0438\u0445 \u043a\u0430\u0447\u0435\u0441\u0442\u0432, \u043f\u0441\u0438\u0445\u0438\u0447\u0435\u0441\u043a\u043e\u0439      \t\n\u0443\u0440\u0430\u0432\u043d\u043e\u0432\u0435\u0448\u0435\u043d\u043d\u043e\u0441\u0442\u0438"]
}
