{
    numb: 301,
    question: "\u0424\u043e\u0440\u043c\u0430 \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u0438 \u0443\u0447\u0435\u0431\u043d\u043e\u0433\u043e \u043f\u0440\u043e\u0446\u0435\u0441\u0441\u0430:",
    answer: "\u0441\u043f\u043e\u0441\u043e\u0431  \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043e\u0432\u0430\u043d\u0438\u044f  \u0443\u0447\u0435\u0431\u043d\u043e\u0433\u043e  \u043f\u0440\u043e\u0446\u0435\u0441\u0441\u0430,  \u0432\u0441\u0435\u0433\u0434\u0430  \u0441\u0432\u044f\u0437\u0430\u043d\u043d\u044b\u0439  \u0441  \u043a\u043e\u043b\u0438\u0447\u0435\u0441\u0442\u0432\u043e\u043c \t\n\u043e\u0431\u0443\u0447\u0430\u0435\u043c\u044b\u0445, \u0432\u0440\u0435\u043c\u0435\u043d\u0435\u043c \u0438 \u043c\u0435\u0441\u0442\u043e\u043c \u043e\u0431\u0443\u0447\u0435\u043d\u0438\u044f, \u043f\u043e\u0440\u044f\u0434\u043a\u043e\u043c \u0435\u0433\u043e \t\u043e\u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043b\u0435\u043d\u0438\u044f \u0438 \u0442.\t \u043f.",
    options: ["\u0441\u043f\u043e\u0441\u043e\u0431  \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043e\u0432\u0430\u043d\u0438\u044f  \u0443\u0447\u0435\u0431\u043d\u043e\u0433\u043e  \u043f\u0440\u043e\u0446\u0435\u0441\u0441\u0430,  \u0432\u0441\u0435\u0433\u0434\u0430  \u0441\u0432\u044f\u0437\u0430\u043d\u043d\u044b\u0439  \u0441  \u043a\u043e\u043b\u0438\u0447\u0435\u0441\u0442\u0432\u043e\u043c \t\n\u043e\u0431\u0443\u0447\u0430\u0435\u043c\u044b\u0445, \u0432\u0440\u0435\u043c\u0435\u043d\u0435\u043c \u0438 \u043c\u0435\u0441\u0442\u043e\u043c \u043e\u0431\u0443\u0447\u0435\u043d\u0438\u044f, \u043f\u043e\u0440\u044f\u0434\u043a\u043e\u043c \u0435\u0433\u043e \t\u043e\u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043b\u0435\u043d\u0438\u044f \u0438 \u0442.\t \u043f.", "\u043e\u0431\u0443\u0447\u0435\u043d\u0438\u0435 \u043f\u043e \u0435\u0434\u0438\u043d\u043e\u043c\u0443 \u0443\u0447\u0435\u0431\u043d\u043e\u043c\u0443 \u043f\u043b\u0430\u043d\u0443 \u0438 \u0435\u0434\u0438\u043d\u044b\u043c \u0443\u0447\u0435\u0431\u043d\u044b\u043c \u043f\u0440\u043e\u0433\u0440\u0430\u043c\u043c\u0430\u043c", "\u043f\u0440\u0435\u0434\u043c\u0435\u0442\u043d\u0430\u044f \u043f\u043e\u0434\u0434\u0435\u0440\u0436\u043a\u0430 \u0443\u0447\u0435\u0431\u043d\u043e\u0433\u043e \u043f\u0440\u043e\u0446\u0435\u0441\u0441\u0430", "\u0441\u0438\u0441\u0442\u0435\u043c\u0430  \u043d\u0430\u0443\u0447\u043d\u044b\u0445  \u043f\u0440\u0430\u043a\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0445  \u0443\u043c\u0435\u043d\u0438\u0439  \u0438  \u043d\u0430\u0432\u044b\u043a\u043e\u0432,  \u0441\u043f\u043e\u0441\u043e\u0431\u043e\u0432  \u0434\u0435\u044f\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u0438  \u0438 \t\n\u043c\u044b\u0448\u043b\u0435\u043d\u0438\u044f, \u043a\u043e\u0442\u043e\u0440\u044b\u043c\u0438 \u0443\u0447\u0430\u0449\u0438\u043c\u0441\u044f \u043d\u0435\u043e\u0431\u0445\u043e\t\u0434\u0438\u043c\u043e \u043e\u0432\u043b\u0430\u0434\u0435\u0442\u044c \u0432 \u043f\u0440\u043e\u0446\u0435\u0441\u0441\u0435 \u043e\u0431\u0443\u0447\u0435\u043d\u0438\u044f", "\u0442\u043e, \u043a \u0447\u0435\u043c\u0443 \u0441\u0442\u0440\u0435\u043c\u0438\u0442\u0441\u044f \u043e\u0431\u0443\u0447\u0435\u043d\u0438\u0435, \u0431\u0443\u0434\u0443\u0449\u0435\u0435, \u043d\u0430 \u043a\u043e\u0442\u043e\u0440\u043e\u0435 \u043d\u0430\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u044b \u0435\u0433\u043e \u0443\u0441\u0438\u043b\u0438\u044f"]
}
